import React from 'react';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { StudentRegister } from './components/StudentRegister';
import { SubjectAssignment } from './components/StudentSubjectAdd';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <header className="App-header">
          <Routes>
            <Route path="/register" element={<StudentRegister />} />
            <Route path="/subjects" element={<SubjectAssignment subjects={subjects} studentId={studentId} />} />
          </Routes>
        </header>
      </BrowserRouter>
    </div>
  );
}

export default App;
